import React from 'react';
import Sidebar from './components/Sidebar';

function App() {
  return (
    <div className="flex">
      <Sidebar />
      <div className="flex-1 p-6">
        {/* Konten utama aplikasi di sini */}
        <h2 className="text-2xl font-bold">Welcome to Take Note</h2>
      </div>
    </div>
  );
}

export default App;
